import React from 'react';
import { Footer, Blog, Possibility, Features, Header, WhatGPT3 } from './containers';
import { CTA, Brand, Navbar } from './components';

import './App.css';

const App = () => {
  return (
    <div className='App'>
      <div className='gradient__bg'>
        <Navbar/>
        <Header/>
      </div>
      <WhatGPT3/> {/* About me*/}
      <Brand/> {/* Languages*/}
      <Blog/> {/* Achievements*/}
      <Features/> {/* Projects*/}
      <Possibility/> {/*Experience*/}
      <CTA/> {/*Gaming*/}
      <Footer/> {/*Footer*/}
    </div>
  )
}

export default App
